import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Import BrowserRouter, Routes, and Route
import ManageMembers from './pages/ManageMembers/manager.jsx'; // Make sure this path is correct

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/manager" element={<ManageMembers />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
